document.addEventListener("DOMContentLoaded",(function(){fetch("/chart_data/pallet_count").then((function(t){return t.json()})).then((function(t){var e={chart:{type:"bar",height:200},series:[{name:"Last 7 Days",data:t.last_7_days},{name:"Last 30 Days",data:t.last_30_days}],xaxis:{categories:t.labels},title:{text:"Pallet Count Per Type"}};new ApexCharts(document.querySelector("#palletCountChart"),e).render()}))}));